import React from 'react'
import { useHistory } from "react-router-dom"
const Header = () => {
    let history = useHistory()
    const handleAddJob = () => {
        history.push(`/add-job`)
    };
    return (
        <>
         <div class="row"><div class="col"><h1 >Product Roles </h1> </div>
        <div class="col"><button onClick={(e)=> handleAddJob(e)} className="btn btn-warning ">Post a job</button> </div>

           </div>


        </>
    )
}

export default Header;
